import register from '../register';
import {open} from './index';
import {getParams} from '../utils';

register('feedback/open', {
    v: 17,
    versionRange: ['10.1'],
    iosinfoVersionRange: ['2.8'],
    androidliteVersionRange: ['3.3'],
    iosmissionVersionRange: ['1.0'],
    androidmissionVersionRange: ['1.0'],
    filter: data => {
        return {
            module: 'utils',
            action: 'feedback'
        };
    }
});

/**
 * 打开举报反馈页面
 *
 * @function openFeedback
 * @param {Object} params 端能力参数，具体值端同学还在整理中，@：liushaohua02@baidu.com
 * @return {Promise} 调用的返回
 */
export default (params = {}) => open(getParams('feedback', params));
